import React from "react";
import styled from "styled-components";
const NavContainer = styled.div`
  position: absolute;
  top: 0;

  display: flex;
`;

const Navbar = () => {
  return <NavContainer>
    <li></li>
  </NavContainer>;
};

export default Navbar;
